import React from "react";
import Service from "../service/Service";

class C extends React.Component{
    constructor(props){
        super(props)
        this.state={
            cs:[]
        }
    }
    componentDidMount(){
        Service.getC().then((response) => {
            this.setState({cs:response.data})

        });
    }
    render(){
        return(
            <div>
                <h1 class="text-center">C Tutorial</h1>
                <table className="table table-striped">
                    <thead>
                        <tr className="feed-item">
                            {/* <td>Html id</td>
                            <td>Name</td>
                            <td>Text</td>
                            <td>Image</td> */}
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.cs.map(
                                c =>
                                <tr key ={c.id}>
                                    <td>{c.id}</td>
                                    <td>{c.name}</td>
                                    {/* <td>{html.text}</td>
                                    <td>{html.image}</td>  */}
                                </tr>
                            )
                        }
                    </tbody>
                </table>

            </div>
        )
    }
}
export default C;
